import React from 'react';
import { useSelector } from 'react-redux';
import './App.css';
import Card from "./Card";


class App extends React.Component {
  constructor(props){
    super(props);
    this.state = {
      toComplete:[],
      completed:[],
      dimensions:4,
      stateRange:3,
      numView:12,
    };
  }
  render(){
    return(
    <div>
      <Card className="card" type={[1,2,3,4]}/>
      <Card className="card" type={[1,2,3,4]}/>
      <Card className="card" type={[1,2,3,4]}/>
      <Card className="card" type={[1,2,3,4]}/>
    </div>
    )
  }
  
}

 

export default App;
